import React, { Component } from "react";

class NumberMods extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <button onClick={this.props.onNumModPress("AC")}>AC</button>
        <button>+/-</button>
        <button>%</button>
      </React.Fragment>
    );
  }
}

export default NumberMods;
